import React from "react"
import { useParams } from "react-router-dom"

const User = ({ user }) => {
  const id = useParams().id
  return (
    <div>
      <h2>{user.username}</h2>
      <h3>added blogs</h3>
      {user.blogs.map((blog) => (
        <div key={blog.id}>{blog.title}</div>
      ))}
    </div>
  )
}

export default User
